import React from 'react'
import './Header.css'

export const Header = () => {
    return (
        <div>
            <div className='header' >
                <h2 style={{ padding: "10px" }}><span style={{ color: 'green' }}>Health</span><span>Coach</span></h2>
            </div>
        </div>
    )
}
